import { Box, Container } from "@mui/material"

function TextToHand() {
    return(
        <Box
         mt={10}
         textAlign='center'
        >
            <Container
            textAlign='center'
            sx={{
               width: 500,
               height: 100,
               border: '1px solid black',
            }}
            >

            </Container>
        </Box>
    )
}

export default TextToHand
